/*Table structure for table `contract_product_c` */

DROP TABLE IF EXISTS `contract_product_c`;

CREATE TABLE `contract_product_c` (
  `CONTRACT_PRODUCT_ID` varchar(40) NOT NULL,
  `CONTRACT_ID` varchar(40) default NULL,
  `FACTORY_ID` varchar(40) default NULL,
  `FACTORY_NAME` varchar(200) default NULL COMMENT '冗余',
  `PRODUCT_NO` varchar(50) default NULL,
  `PRODUCT_IMAGE` varchar(200) default NULL,
  `PRODUCT_DESC` varchar(600) default NULL,
  `LOADING_RATE` varchar(30) default NULL COMMENT '报运：x/y',
  `BOX_NUM` int(11) default NULL COMMENT '报运',
  `PACKING_UNIT` varchar(10) default NULL COMMENT 'PCS/SETS',
  `CNUMBER` int(11) default NULL,
  `OUT_NUMBER` int(11) default NULL COMMENT '报运',
  `FINISHED` int(11) default NULL COMMENT '报运',
  `PRODUCT_REQUEST` varchar(2000) default NULL,
  `PRICE` decimal(10,2) default NULL,
  `AMOUNT` decimal(10,2) default NULL COMMENT '自动计算: 数量x单价',
  `ORDER_NO` int(11) default NULL,
  PRIMARY KEY  (`CONTRACT_PRODUCT_ID`),
  KEY `FK6289B9E6F17C2D98` (`CONTRACT_ID`),
  KEY `FK6289B9E6586B149C` (`FACTORY_ID`),
  CONSTRAINT `FK6289B9E6586B149C` FOREIGN KEY (`FACTORY_ID`) REFERENCES `factory_c` (`FACTORY_ID`),
  CONSTRAINT `FK6289B9E6F17C2D98` FOREIGN KEY (`CONTRACT_ID`) REFERENCES `contract_c` (`CONTRACT_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

