/*Table structure for table `user_p` */

DROP TABLE IF EXISTS `user_p`;

CREATE TABLE `user_p` (
  `USER_ID` varchar(40) NOT NULL,
  `DEPT_ID` varchar(40) default NULL,
  `USER_NAME` varchar(50) default NULL COMMENT '不能重复,可为中文',
  `PASSWORD` varchar(64) default NULL COMMENT 'shiro MD5密码32位',
  `STATE` int(11) default NULL COMMENT '1启用0停用',
  `CREATE_BY` varchar(40) default NULL COMMENT '登录人编号',
  `CREATE_DEPT` varchar(40) default NULL COMMENT '登录人所属部门编号',
  `CREATE_TIME` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  `UPDATE_BY` varchar(40) default NULL,
  `UPDATE_TIME` timestamp NOT NULL default '0000-00-00 00:00:00',
  PRIMARY KEY  (`USER_ID`),
  KEY `FK95BE28DC369F7BB8` (`DEPT_ID`),
  CONSTRAINT `FK95BE28DC369F7BB8` FOREIGN KEY (`DEPT_ID`) REFERENCES `dept_p` (`DEPT_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

